import "./App.css";
import Layout from "./components/Layout/Layout";

import {Routes , Route ,Navigate} from 'react-router-dom'

import Home from '../pages/Home';
import Tours from '../pages/Tours';
import ToursDetails from './../pages/ToursDetails';
import Login from '../pages/Login';
import Register from '../pages/Register';
import SearchResultList from '../pages/SearchResultList';

function App() {
  return (
<Routes>
    <Route path='/' element={<Navigate to='/home'/>} />
    <React path='/home' element={<Home/>} />
    <React path='/tours' element={<Tours/>} />
    <React path='/tours/:id' element={<ToursDetails/>} />
    <React path='/login' element={<Login/>} />
    <React path='/register' element={<Register/>} />
    <React path='/tours/search' element={<SearchResultList/>} />

</Routes>

  //  <Layout/>
  )
}

export default App;
